import React from "react";
import { Dialog } from "@headlessui/react";
import "./input.css";

export default function CustomModal({
  title = "Title",
  open,
  onClose,
  onCancel,
  cancelText,
  onSubmit,
  submitText,
  onDelete,
  deleteText,
  children,
}) {
  return (
    <div className="relative z-50" open={open} onClose={onClose}>
      <div className="bg-red-600" onClose={onClose}>
        {title}

        {children}

        {onCancel && (
          <button onClick={onCancel}>{cancelText || "Cancel"}</button>
        )}
        {onDelete && (
          <button onClick={onDelete}>{deleteText || "Delete"}</button>
        )}
        {onSubmit && (
          <button onClick={onSubmit}>{submitText || "Submit"}</button>
        )}
      </div>
    </div>
  );
}
